import React from 'react';  
import { Container, Col, Row } from 'reactstrap';
import Signup from '../home/Signup';
import Login from '../home/Login';

const Auth = (props) => {
    return ( 
        <Container className="auth-container">
            <Row>
                <Col md="4">
                    <Signup/>
                </Col>
                </Row>


            <Row>
                <Col md="4" className="login-col">
                    <Login/>
                </Col>
                </Row>
                </Container>  

     );
}

export default Auth;
